import React, { useState } from "react";
import AddCargo from "./AddCargo";
import CargoList from "./CargoList";

const App = () => {
  const [cargoList, setCargoList] = useState([
    {
      id: "CARGO001",
      name: "Строительные материалы",
      status: "В пути",
      origin: "Москва",
      destination: "Казань",
      departureDate: "2024-11-24",
    },
    {
      id: "CARGO002",
      name: "Хрупкий груз",
      status: "Ожидает отправки",
      origin: "Санкт-Петербург",
      destination: "Екатеринбург",
      departureDate: "2024-11-26",
    },
  ]);

  // Функция для добавления нового груза
  const addCargo = (newCargo) => {
    setCargoList((prevList) => [...prevList, newCargo]);
  };

  return (
    <div>
      <h1>Отслеживание грузов</h1>
      <AddCargo addCargo={addCargo} />
      <CargoList cargoList={cargoList} />
    </div>
  );
};

export default App;
